import React, { useRef } from 'react'
import {withRouter} from 'react-router-dom'

const SignUpForm = (props) => {
    const name = useRef();
    const n_name = useRef();
    const passwd = useRef();
    const birth_y = useRef();
    const region = useRef();

    const submit = async() => {
        const formData = {
            name : name.current.value,
            n_name : n_name.current.value,
            passwd : passwd.current.value,
            birth_y : birth_y.current.value,
            region : region.current.value,
        }
        console.log(formData);
        await props.onSubmit(formData);

        props.history.push('/');
    }
    const cancel = () => {
        props.history.goBack();
    }

    return(
        <>
            <div>Name : <input ref={name}></input></div>
            <div>Nickname : <input ref={n_name}></input></div>
            <div>Password : <input ref={passwd} type="password"></input></div>
            <div>Birth_Y : <input ref={birth_y}></input></div>
            <div>Region : <input ref={region}></input></div>
            <button onClick={()=>submit()}>작성</button>
            <button onClick={()=>cancel()}>취소</button>
        </>
    )
}

export default withRouter(SignUpForm);
